function Introduction(){
  return(
    <div className="intro">
      <h1 className="intro-text">
      // Hi I'm Eva,<br/>an aspiring software developer
      <TypeAnimation
        cursor={true}
        sequence={['Hi I\'m Eva', 1000, '']}
        wrapper="h2"
        repeat={1}
       />
       <TypeAnimation
         cursor={false}
         sequence={['an aspiring software developer', 1000, '']}
         wrapper="h2"
         repeat={1}
        />
      </h1>
      <img src={profilepic} className="intro-img"/>
    </div>
  );
}

function App() {
  return (
    <div className="homepage">
    <Introduction/>
    </div>
  );
}

export default App;
